class Solution {
public:
    vector<int> pivotArray(vector<int>& nums, int pivot) {
        vector<int> low, mid, high, ans;
        for (int x: nums) {
            if (x == pivot) {
                mid.push_back(x);
            } else if (x > pivot) {
                high.push_back(x);
            } else {
                low.push_back(x);
            }
        }
        for (int x: low) ans.push_back(x);
        for (int x: mid) ans.push_back(x);
        for (int x: high) ans.push_back(x);
        return ans;
    }
};
